value:
{
    env {
      - jest: true
      + jest: false
        node: true
    }
    extends: [airbnb-base]
    extends: [airbnb-base-1]
    parserOptions {
        ecmaVersion: latest
    }
    rules {
        import/extensions: [error, ignorePackages, {js:always}]
        import/extensions: [error, ignorePackages]
      - no-console: 0
      + no-console: 1
        no-underscore-dangle: [2, {allow:[__filename, __dirname]}]
        no-underscore-dangle: [2, {allow:[__filename, __dirname]}]
    }
}
